tinymce.create("tinymce.plugins.dbTagCloudPlugin",{init:function(t,n){t.addCommand("mceTagCloud",function(){var t=tinyMCE.activeEditor.selection.getContent({format:"raw"}),n=dbTagCloudCols;tinyMCE.activeEditor.selection.setContent('[tagcloud attr="'+t+'" cols="'+n+'"]')}),t.addButton("tagcloud",{title:"Tag Cloud",cmd:"mceTagCloud",image:n+"/../img/icon.svg"})},createControl:function(t,n){return null},getInfo:function(){return{longname:"DB Tagcloud Plugin",author:"Denis Bisteinov",authorurl:"https://bisteinoff.com",infourl:"https://bisteinoff.com",version:"1.1"}}}),tinymce.PluginManager.add(dbTagCloudPluginFolder,tinymce.plugins.dbTagCloudPlugin);